import { Redirect } from 'react-router-dom';

class VerificarSesion extends Component {
    render() {
        return ( 
            ( sessionStorage.getItem('token')!== '')?
            <div></div> 
            : 
            <Redirect to ='/login' ></Redirect>

        )
    }
}
export default VerificarSesion;
